/*------------------------------DATA TABLE product----------------------------------------*/
/* global resultEmail */

const path_services = "/GICO-AD/webresources";
const path = "/product";
var productos = [];
var clientes = [];
var proformaTime = 0;
var proformaIdGlobal;
var totalacumulado = 0;

function producto(nombre, cantidad, precioUnitario, valorTotal) {
    this.nombre = nombre;
    this.cantidad = cantidad;
    this.precioUnitario = precioUnitario;
    this.valorTotal = valorTotal;
}
function cliente(nombre, ci, direccion) {
    this.nombre = nombre;
    this.ci = ci;
    this.direccion = direccion;
}

$(document).ready(function () {

    var formularioAdd = document.id_form_orderProforma,
            elementosAdd = formularioAdd.elements;

    //     Funcion que se ejecuta cuando el evento click es activado
    var focusInput = function () {
        this.parentElement.children[1].className = "label active";
        this.parentElement.children[0].className = this.parentElement.children[0].className.replace("error", "");
    };
    var blurInput = function () {
        if (this.value <= 0) {
            this.parentElement.children[1].className = "label";
            this.parentElement.children[0].className = this.parentElement.children[0].className + " error";
        }
    };
    // --- Eventos ---
    for (var i = 0; i < elementosAdd.length; i++) {
        if (elementosAdd[i].type === "text" || elementosAdd[i].type === "number" || elementosAdd[i].type === "email" || elementosAdd[i].type === "password") {
            elementosAdd[i].addEventListener("focus", focusInput);
            elementosAdd[i].addEventListener("blur", blurInput);
        }
    }

    let temp = 0;
    $.ajax({
        url: "/GICO-AD/webresources/proforma/listfinalProforma",
        type: 'GET',
        dataType: 'json',
        dataSrc: '',
        success: function (datas) {
            console.log(datas);
            console.log(datas.length);
            console.log(datas[0].userTypeDescription);
            clientes = [];
            let clientName;
            let clientCI;
            let clientAddress;
            if (temp === 0) {
                temp++;
                for (var i = 0; i < datas.length; i++) {
                    $("#proformaInfo").append(
                            '<label>Cliente: </label>', '<input type="text" disabled value="' + datas[i].oClient.clientName + '"></input>',
                            '<label>Cedula: </label>', '<input type="text" disabled value="' + datas[i].oClient.clientCi + '"></input>',
                            '<label>Direccion: </label>', '<input type="text" disabled value="' + datas[i].oClient.clientAddress + '"></input>',
                            '<label>Diaz de validez: </label>', '<input id="timeProforma" type="text" disabled value="' + datas[i].proformaTime + '"></input>',
                            '<label>Total Proforma: </label>', '<input id="totalProforma" type="text" disabled value="0"></input>'
                            );

                    proformaTime = datas[i].proformaTime;
                    proformaIdGlobal = datas[i].proformaId;
                    clientName = datas[i].oClient.clientName;
                    clientCI = datas[i].oClient.clientCi;
                    clientAddress = datas[i].oClient.clientAddress;
                    let client = new cliente(clientName, clientCI, clientAddress);
                    clientes.push(client);
                    i = datas.length;
                }
            }
        }
    });


    productos = [];
    let table = $('#gblTable').DataTable({
        dom: 'lfrtip',
        lengthMenu: [5, 10, 25, 50],
        columnDefs: [
            {className: "dt-center", targets: [1, 2, 3, 4]},
            {targets: 3, bSortable: false},
            {targets: 2, bSortable: false, tooltip: "modificar"},
            {targets: 1, bSortable: false}
        ],
        "scrollX": true,
        "scrollY": true,
        responsive: true,
        "language": {"url": "dataTables/languaje.json"},
        ajax: {
            url: `${path_services}${path}/listProduct`, //Traemos informacion del servicio restful
            type: 'GET',
            dataType: 'json',
            dataSrc: ''
        },
        columns: [//carga la informacion en cada columna del datatable
            {data: 'productName'},
            {data: 'productDescription'},
            {data: 'productCount'},
            {data: 'productPrice'},
            {data: iconOrderProforma}
        ]

    });
    /*------------------------------ICONOS DATATABLES----------------------------------------*/

    function iconOrderProforma(data) {
        let datas = '<a id="orderProforma" title="Devolucion en Ventas" href="#" productId-data="' + data.productId + '"productName-data="' + data.productName + '" \n\
         productDescription-data="' + data.productDescription + '" \n\
         productCount-data="' + data.productCount + '" \n\
         productPrice-data="' + data.productPrice + '"productIva-data="' + data.productIva + '"\n\
         productTotalValue-data="' + data.productTotalValue + '" \n\
         productUtility-data="' + data.productUtility + '"productAveragePrice-data="' + data.productAveragePrice + '"\n\
         productDateExpiration-data="' + data.productDateExpiration + '" class="icon-table">\n\
         <i class="fa fa-shopping-cart" aria-hidden="true"></i></a>';
        return datas;
    }

    /*------------------------------RETURN SALE product----------------------------------------*/


    function orderProformaProduct() {
        let productName = $('#productName-orderProformaModal').text();
        let productPrice = $('#productPrice-orderProformaModal').text();
        let productCount = $('#productCount-orderProformaModal').text();
        let productNewCount = $('input[name="productNewCount-orderProforma"]').val();

        let proformaMType = "1";
        let productId = $('#productId-orderProformaModal').text();
        let productDescription = $('#productDescription-orderProformaModal').text();
        let productIva = $('#productIva-orderProformaModal').text();
        let productDateExpiration = $('#productDateExpiration-orderProformaModal').text();

        let productTotalValue = $('#productTotalValue-orderProformaModal').text();
        let productUtility = $('#productUtility-orderProformaModal').text();
        let productAveragePrice = $('#productAveragePrice-orderProformaModal').text();

        let proformaId = proformaIdGlobal;

        let formData = new FormData();
        formData.append('proformaMType', proformaMType);
        formData.append('productId', productId);
        formData.append('proformaId', proformaId);
        formData.append('productPrice', productPrice);
        formData.append('productIva', productIva);
        formData.append('productCount', productNewCount);
        formData.append('productUtility', productUtility);

        formData.append('productName', productName);
        formData.append('productDescription', productDescription);
        formData.append('productDateExpiration', productDateExpiration);
        formData.append('productTotalValue', productTotalValue);
        formData.append('productAveragePrice', productAveragePrice);


        if (productNewCount > 0) {
            if ((productNewCount > parseFloat(productCount))) {
                alert('ERROR\n\
                   La cantidad deseada es mayor a la que se posee en stock');
            } else {
                $('#totalProforma').val(totalacumulado + (parseFloat(productPrice) * parseFloat(productNewCount)));
                totalacumulado = parseFloat($('#totalProforma').val());
                $.ajax({
                    url: `${path_services}/proforma/managementProformaProduct`, //Traemos informacion del servicio restful
                    type: 'POST',
                    data: formData,
                    cache: false,
                    contentType: false,
                    processData: false,
                    success: function (data) {
//                        alert(data.message);
                        table.ajax.reload();
                    },
                    error: function (jqxhr, status, errorMsg) {
                        console.log(status + "Client: " + errorMsg);
                    }});

                let total = parseFloat(productNewCount) * parseFloat(productPrice);
                let precio = parseFloat(productPrice) * 1;
                let produc = new producto(productName, productNewCount, precio.toFixed(2), total.toFixed(2));
                productos.push(produc);

            }
        } else {
            alert('ERROR\n\
                    Cantidad incorrecta');
        }
    }

    function UpdateProforma() {
        // Display the month, day, and year. getMonth() returns a 0-based number.
        var dt = new Date();
        var month = dt.getMonth() + 1;
        var day = dt.getDate();
        var year = dt.getFullYear();

        let proformaMType = "4";
        let proformaId = proformaIdGlobal;
        let clientId = "1";
        let proformaTotal = totalacumulado;
        let proformaTime = $('#timeProforma').val();
        alert(proformaTime);
        let proformaState = "1";
        let proformaDate = year + '-' + month + '-' + day;
        if ((proformaTime === '') || (clientId === '')) {
            alert(proformaTotal + "gg" + proformaTime + "cid"+clientId);
            alert('Por Favor llene todos los campos por favor');
        } else {
            orderProformaPDF();
            let formData = new FormData();

            formData.append('proformaMType', proformaMType);
            formData.append('proformaId', proformaId);
            formData.append('clientId', clientId);
            formData.append('proformaTotal', proformaTotal);
            formData.append('proformaTime', proformaTime);
            formData.append('proformaState', proformaState);
            formData.append('proformaDate', proformaDate);
            $.ajax({
                url: `${path_services}/proforma/managementProforma`, //Traemos informacion del servicio restful
                type: 'POST',
                data: formData,
                cache: false,
                contentType: false,
                processData: false,
                success: function (data) {
//                    alert(data.message);
                    table.ajax.reload();
                },
                error: function (jqxhr, status, errorMsg) {
                    console.log(status + "Client: " + errorMsg);
                }});
//        $('#windows-update-select-client').removeClass()('hide-modal');
        }
    }

    $(document).on('click', 'a#orderProforma', function (e) {//Mostrar la ventana modal de agregar stock producto
        e.preventDefault();
        let productId = $(this).attr("productId-data");
        let productName = $(this).attr("productName-data");
        let productDescription = $(this).attr("productDescription-data");
        let productPrice = $(this).attr("productPrice-data");
        let productIva = $(this).attr("productIva-data");
        let productDateExpiration = $(this).attr("productDateExpiration-data");
        let productCount = $(this).attr("productCount-data");
        let productTotalValue = $(this).attr("productTotalValue-data");
        let productUtility = $(this).attr("productUtility-data");
        let productAveragePrice = $(this).attr("productAveragePrice-data");

        $('#windows-proforma').removeClass('hide-modal'); //Muestra la ventan modal

        $('#productId-orderProformaModal').text(productId);
        $('#productName-orderProformaModal').text(productName);
        $('#productDescription-orderProformaModal').text(productDescription);
        $('#productPrice-orderProformaModal').text(productPrice);
        $('#productIva-orderProformaModal').text(productIva);
        $('#productDateExpiration-orderProformaModal').text(productDateExpiration);
        $('#productCount-orderProformaModal').text(productCount);
        $('#productTotalValue-orderProformaModal').text(productTotalValue);
        $('#productUtility-orderProformaModal').text(productUtility);
        $('#productAveragePrice-orderProformaModal').text(productAveragePrice);
    });
    $(document).on('click', '#closeIcon-orderProforma', function () {// Cerrar la Ventana Modal desde el icono
        $('#windows-proforma').toggleClass('hide-modal');
        $("#id-form-proforma")[0].reset();
    });
    $(document).on('click', '#orderProforma-product-cancel', function () {//Boton CANCELAR modificar producto 
        $('#windows-proforma').toggleClass('hide-modal');
        $("#id-form-proforma")[0].reset();
    });
    $(document).on('click', '#orderProforma-product', function () {//Boton ACEPTAR modificar producto 
        orderProformaProduct();
        $("#id-form-proforma")[0].reset();
        $('#windows-proforma').toggleClass('hide-modal');
    });

    $(document).on('click', '#id-update-proforma', function () {// Mostrar ventana modal ingresar producto    
        $('#daysProforma-updateModal').val(proformaTime);
        $('#windows-update-select-client').removeClass('hide-modal');
    });

    $(document).on('click', '#closeIcon-updateProforma', function () {
        $('#windows-update-select-client').toggleClass('hide-modal');
    });

    $(document).on('click', '#update-client-cancel', function () {
        $('#windows-update-select-client').toggleClass('hide-modal');
    });

    $(document).on('click', '#update-client', function () {
        $('#timeProforma').val($('#daysProforma-updateModal').val());
        UpdateProforma();
        $('#windows-update-select-client').toggleClass('hide-modal');

    });

    $(document).on('click', '#id-create-proforma', function () {
        if (clientes.length > 0) {
            UpdateProforma();
            
        } else {
            alert('El cliente no ha sido asignado');
        }
    });


    function orderProformaPDF() {
        if (productos.length > 0) {
            

            var reporte = new jsPDF('p', 'mm', 'a4');

//          reporte.text(productos[0].nombre, largo,alto); 
            reporte.setFontSize(15);
            reporte.setFont("times");
            reporte.setFontType("bold");
            reporte.text('COMERCIAL ORTIZ', 45, 30);
            reporte.setFontSize(13);
            reporte.text('Telefono: 0987654321', 47, 40);
            reporte.text('PROFORMA', 49, 50);
            reporte.setFontType("normal");
            var fecha = new Date();
            var mm = fecha.getMonth() + 1;
            reporte.text('Lugar: Mocha', 25, 60);
            reporte.text('Fecha: ' + fecha.getDate() + ' / ' + mm + ' / ' + fecha.getFullYear() + '', 25, 70);
            reporte.text('Sr(a): ' + clientes[0].nombre + ' ', 25, 80);
            reporte.text('CI: ' + clientes[0].ci + ' ', 25, 90);
            reporte.text('Direccion Cliente: ' + clientes[0].direccion + ' ', 25, 100);
            reporte.setFontSize(13);
            reporte.setFont("times");
            reporte.setFontType("bold");
//          reporte.setTextColor(255, 0, 0);
            reporte.text('_____________________________________________________________________________', 25, 105);
            reporte.text(' Cant.        Nombre                                                                                   P. Unitario     P. Total', 25, 113);
            reporte.text('_____________________________________________________________________________', 25, 115);
            reporte.setFontType("normal");
            let interlineado = 123;
            let sumaTotal = 0;
            for (var i = 0; i < productos.length; i++) {
                reporte.text('' + productos[i].cantidad + ' ', 25, interlineado);
                reporte.text('' + productos[i].nombre + ' ', 45, interlineado);
                reporte.text('' + productos[i].precioUnitario + ' ', 165, interlineado);
                reporte.text('' + productos[i].valorTotal + ' ', 188, interlineado);
                if (interlineado >= 293) {
                    reporte.addPage();
                    interlineado = 33;
                } else {
                    interlineado = interlineado + 10;
                }
                sumaTotal = sumaTotal + parseFloat(productos[i].valorTotal);
            }
            reporte.setFontType("bold");
            if (interlineado > 280) {
                reporte.addPage();
                interlineado = 33;
            } else {
                interlineado = interlineado + 6;
            }
            reporte.text('_____________________________________________________________________________', 25, interlineado);
            interlineado = interlineado + 10;
            reporte.text(' TOTAL                                                                                                                                ' + sumaTotal.toFixed(2) + '', 25, interlineado);

            var imgData = 'data:image/jpeg;base64,';
            reporte.addImage(imgData, 'JPEG', 125, 15, 70, 60);
            reporte.save('proforma' + clientes[0].nombre + '.pdf');
            var pagina = "adminProforma.jsp";
            location.href = pagina;
        } else {
            alert('la lista de pedido esta vacia');
        }
    }

});
